{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/natalienmh/cyclistic-bike-share-analysis-with-r?scriptVersionId=108055980\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"526f6e7b","metadata":{"papermill":{"duration":0.027592,"end_time":"2022-10-14T07:27:41.08304","exception":false,"start_time":"2022-10-14T07:27:41.055448","status":"completed"},"tags":[]},"source":["# Case Study\n","\n","*The case study \"How Does a Bike-Share Navigate Speedy Success?\" is a part of capstone project from Google Data Analytics Certificate. This notebook acts as a documentation for the data analysis process and findings of the case study.*\n","\n","*Please feel free to leave a comment if you have any suggestions or further questions!*\n","\n"]},{"cell_type":"markdown","id":"8e80de34","metadata":{"papermill":{"duration":0.024406,"end_time":"2022-10-14T07:27:41.132374","exception":false,"start_time":"2022-10-14T07:27:41.107968","status":"completed"},"tags":[]},"source":["# Introduction\n","\n","**Scenario**\n","\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","**Problem**\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno, the Director of Marketing, believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends.\n","\n","**Business task**\n","\n","* Identify and analyze the difference in using Cyclistic bikes of annual members and casual riders.\n","* Present top three recommendations based on the analysis.\n","\n","\n","\n","\n"]},{"cell_type":"markdown","id":"a4dac55c","metadata":{"papermill":{"duration":0.023971,"end_time":"2022-10-14T07:27:41.180881","exception":false,"start_time":"2022-10-14T07:27:41.15691","status":"completed"},"tags":[]},"source":["# About Dataset\n","\n","The datasets have a different name because Cyclistic is a fictional company. The data has been made available by Motivate International Inc. under this [license](http://ride.divvybikes.com/data-license-agreement). This is public data that can be used to explore how different customer types are using Cyclistic bikes. The datasets can be downloaded [here](http://divvy-tripdata.s3.amazonaws.com/index.html).\n","\n","For purpose of this project, there are 12 csvs of the last 12 months (Aug 2021-Sep 2022) - each listing 13 columns as below:  \n","1.\"ride_id\"  \n","2.\"rideable_type\"  \n","3.\"started_at\"  \n","4.\"ended_at\"  \n","5.\"start_station_name\"  \n","6.\"start_station_id\"  \n","7.\"end_station_name\"  \n","8.\"end_station_id\"  \n","9.\"start_lat\"  \n","10.\"start_lng\"  \n","11.\"end_lat\"  \n","12.\"end_lng\"  \n","13.\"member_casual\"  \n"]},{"cell_type":"markdown","id":"9a914797","metadata":{"papermill":{"duration":0.024771,"end_time":"2022-10-14T07:27:41.229653","exception":false,"start_time":"2022-10-14T07:27:41.204882","status":"completed"},"tags":[]},"source":["# Prepare and Process Data\n","\n","## Set up and install packages "]},{"cell_type":"code","execution_count":1,"id":"b145b09f","metadata":{"execution":{"iopub.execute_input":"2022-10-14T07:27:41.285152Z","iopub.status.busy":"2022-10-14T07:27:41.28294Z","iopub.status.idle":"2022-10-14T07:27:43.101879Z","shell.execute_reply":"2022-10-14T07:27:43.100131Z"},"papermill":{"duration":1.8489,"end_time":"2022-10-14T07:27:43.104532","exception":false,"start_time":"2022-10-14T07:27:41.255632","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4 \n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.1 \n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filte